import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import ConsolidationForm from './ConsolidationForm';
import Register from './Register';
import Clients from './Clients';

const Admin = () => {
  return (
    <div className="flex min-h-screen">
      {/* Menú lateral */}
      <aside className="w-64 bg-gray-800 text-white">
        <nav className="mt-10">
          <ul>
            <li className="bg-gray-900">
              <Link to="/admin/consolidation" className="block px-4 py-2">
                Consolidación
              </Link>
            </li>
            <li className="bg-gray-900">
              <Link to="/admin/register" className="block px-4 py-2">
                Registro
              </Link>
            </li>
            <li className="bg-gray-900">
              <Link to="/admin/master" className="block px-4 py-2">
                Clientes
              </Link>
            </li>
            {/* Puedes agregar más opciones aquí */}
          </ul>
        </nav>
      </aside>

      {/* Contenido principal */}
      <main className="flex-grow bg-gray-100 p-8">
        <Routes>
          <Route path="/consolidation" element={<ConsolidationForm />} />
          <Route path="/register" element={<Register />} />
          <Route path="/master" element={<Clients />} />
          {/* Agrega más rutas si es necesario */}
        </Routes>
      </main>
    </div>
  );
};

export default Admin;
